  false,\n\t\"url\": null,\n\t\"notes\": \"Watershed Sciences, Inc. (WSI) collected
  Light Detection and Ranging (LiDAR) data for the Lewis County survey area for the
  Puget Sound LiDAR Consortium. This data set covers approximately 547 square miles.
  Delivery 1 of the survey area was collected on July 18th, 19th and 20th of 2009.
  The LiDAR survey utilized both a Leica ALS60 and a Leica ALS50-II sensor in a Cessna
  Caravan 208B. All areas were surveyed with an opposing flight line side-lap of 50%
  (=100% overlap) to reduce laser shadowing and increase surface laser painting. The
  Leica laser systems allow up to four range measurements (returns) per pulse, and
  all discernible laser returns were processed for the output dataset. This LiDAR
  survey achieved a nominal point spacing of 8.82 points per square meter.\",\n\t\"license_title\":
